import React from "react";
import { Link } from "react-router-dom";
import avatar from "../Assets/avatar.png";

function Home() {
  return (
    <div class="dark:bg-gray-100 p-8">
      <div class="grid max-w-screen-xxl px-4 py-8 mx-auto lg:gap-8 xl:gap-0 lg:py-16 lg:grid-cols-12">
        <div class="mr-auto place-self-center lg:col-span-8">
          <h1 class="max-w-3xl mb-4 text-5xl font-extrabold tracking-tight leading-none md:text-5xl xl:text-6xl dark:text-white">
            Welcome to Tarun's Portfolio
          </h1>
          <p class="max-w-2xl mb-6 font-light text-gray-500 lg:mb-8 md:text-xl lg:text-2xl dark:text-gray-400">
          I'm a Software Developer, Technical Writer, YouTuber, and a passionate learner. I am currently writing various Technical Articles at 
          <span className="bg-blue text-white px-1 rounded ml-2">GeeksforGeeks</span>
          </p>
          <Link
            to="/about"
            class="inline-flex items-center justify-center px-5 py-3 text-base font-medium text-center text-gray-900 border border-gray-300 rounded-lg hover:bg-gray-100 focus:ring-4 focus:ring-gray-100 dark:text-white dark:border-gray-700 dark:hover:bg-gray-700 dark:focus:ring-gray-800"
          >
            About
          </Link>
        </div>
        <div class="wp3-- lg:mt-0 lg:col-span-3 lg:flex">
          <img src={avatar} alt="avatar" />
        </div>
      </div>
    </div>
  );
}

export default Home;
